import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import NavbarRB from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const CustomNavbar = () => {
  return (
    <NavbarRB expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <NavbarRB.Brand Style="margin-left : 30px" href="#">logo</NavbarRB.Brand>
        <NavbarRB.Toggle aria-controls="navbarScroll" />
        <NavbarRB.Collapse id="navbarScroll">
          <Row className="w-100 align-items-center">
            {/* Center the search bar */}
            <Col lg={4} className="d-flex justify-content-center order-lg-2">
              <Form className="d-flex">
                <Form.Control
                  type="search"
                  placeholder="Search"
                  className="me-2"
                  aria-label="Search"
                />
                <Button variant="outline-success">Search</Button>
              </Form>
            </Col>
            {/* Empty column to help center the search bar */}
            <Col lg={4} className="order-lg-1 d-none d-lg-flex"></Col>
            {/* Align the navigation links to the right */}
            <Col lg={4} className="d-flex justify-content-end order-lg-3">
              <Nav className="my-2 my-lg-0" navbarScroll>
                <Nav.Link href="#action1">Home</Nav.Link>
                <Nav.Link href="#action2">Login</Nav.Link>
                <NavDropdown title="Link" id="navbarScrollingDropdown">
                  <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                  <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </Col>
          </Row>
        </NavbarRB.Collapse>
      </Container>
    </NavbarRB>
  );
}

export default CustomNavbar;
